Your worst fear is never being financially stable, but you choose to stay at a dead end job that you know doesn't align with your purpose, doesn't provide the financial security you need, and you have poor spending habits...

Do you see how we can play right in to the hand of our own fear sometimes?

It can only change once you recognize the issue!
Let's talk about it.

